import { GET_UPDATE_USER_CRM } from "./valiable.reducer";

const initialState = {
    dataUserUpdate: {}
}

export const userReducer = (state = initialState, action) => {
    switch (action.type) {
        case GET_UPDATE_USER_CRM: {
            state.dataUserUpdate = action.datas;
            return { ...state }
        }

        default:
            return state
    }
}
